nt environment. Subero introduces you to linear, tree, and hash data structures and gives you important insights behind the most common algorithms that you can directly apply to your own programs. Codeless Data Structures and Algorithms provides you with the knowledge about DSAs that you will need in the professional programming world, without using any complex mathematics or irrelevant information. Whether you are a new developer seeking a basic understanding of the subject or a decision-maker wanting a grasp of algorithms to apply to your projects, this book belongs on your shelf. Quite often, a new, refreshing, and unpretentious approach to a topic is all you need to get inspired. What You'll LearnUnderstand tree data structures without delving into unnecessary details or going into too much theoryGet started learning linear data structures with a basic discussion on computer memory Study an overview of arrays, linked lists, stacks and queues Who This Book Is ForThis book is for beginners, self-taught developers and programmers, and anyone who wants to understand data structures and algorithms but donâ€™t want to wade through unnecessary details about quirks of a programming language or donâ€™t have time to sit and read a massive book on the subject. This book is also useful for non-technical decision-makers who are curious about how algorithms work.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9781484257258"},{"type":"ISBN_10","identifier":"1484257251"}],"readingModes":{"text":true,"image":true},"pageCount":143,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"1.1.1.0.preview.3","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=GXvQDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=GXvQDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com.eg/books?id=GXvQDwAAQBAJ&printsec=frontcover&dq=subject+:+programming&hl=&cd=6&source=gbs_api","infoLink":"http://books.google.com.eg/books?id=GXvQDwAAQBAJ&dq=subject+:+programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Codeless_Data_Structures_and_Algorithms.html?hl=&id=GXvQDwAAQBAJ"},"saleInfo":{"country":"EG","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"EG","viewability":"PARTIAL","embeddable":true,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":true,"acsTokenLink":"http://books.google.com.eg/books/download/Codeless_Data_Structures_and_Algorithms-sample-epub.acsm?id=GXvQDwAAQBAJ&format=epub&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"pdf":{"isAvailable":true,"acsTokenLink":"http://books.google.com.eg/books/download/Codeless_Data_Structures_and_Algorithms-sample-pdf.acsm?id=GXvQDwAAQBAJ&format=pdf&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"webReaderLink":"http://play.google.com/books/reader?id=GXvQDwAAQBAJ&hl=&source=gbs_api","accessViewStatus":"SAMPLE","quoteSharingAllowed":false},"searchInfo":{"textSnippet":"Regardless of your programming language background, Codeless Data Structures and Algorithms has you covered. In this book, author Armstrong Subero will help you learn DSAs without writing a single line of code."}},{"kind":"books#volume","id":"LdSoCAAAQBAJ","etag":"pyvYF7jLcSs","selfLink":"https://www.googleapis.com/books/v1/volumes/LdSoCAAAQBAJ","volumeInfo":{"title":"Object-Oriented Programming","subtitle":"in Oberon-2","authors":["Hanspeter MÃ¶ssenbÃ¶ck"],"publisher":"Springer Science & Business Media","publishedDate":"2012-12-06","description":"Without a doubt the idea of object-oriented programming has brought some motion into the field of programming methodology and enlarged the set of programming languages. Object-oriented programming is nothing new-it first arose in the sixties. The motivation came from the simulation of discrete event systems. The concept first manifested itself in the language Simula 67. It took nearly two decades for the method to gain impetus, and today object-oriented programming is an important concept and a powerful technique. Meanwhile, we can even speak of an over reaction, for the concept has become a buzzword. But buzzwords always appear where there is the hope of exploiting ill-informed clients because they see the new approach as the solution to all their problems. Thus object-oriented programming is often hailed as a panacea. And so the question is justified: What is really behind it? To let the cat out of the bag: There is more to object-oriented programming than merely putting data as objects in the fore ground, instead of algorithms to which the data are subject. It is more than purely an alternative view of programmed systems. To identify the essence of object-oriented programming, is the subject of this book. This is a textbook that shows in a didactically skillful way which concepts and constructs are new, where they can be employed reasonably, and what advantages they offer. For, not all programs are automatically improved by merely recasting them in an object-oriented style.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9783642974793"},{"type":"ISBN_10","identifier":"3642974791"}],"readingModes":{"text":false,"image":true},"pageCount":278,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"preview-1.0.0","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=LdSoCAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=LdSoCAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","p